import {CardWrapper, MovieImg, MovieInfo, NoThumbnail, RankWrapper} from "./styles";
import noThumbnailImg from "../../asset/no_thumbnail.svg";

const BoxOfficeCard = ({ data }) => {
  const sliceAttendance = data.attendance.slice(3);

  return (
    <CardWrapper>
      <MovieImg>
        {
          data.image
            ? <img src={data.image} alt="boxoffice_image" />
            : (
              <NoThumbnail>
                <p>썸네일 이미지가</p>
                <p>없습니다</p>
              </NoThumbnail>
            )
        }
        <RankWrapper>
          <p>
            { data.rank }
          </p>
        </RankWrapper>
      </MovieImg>
      <MovieInfo>
        <p>{ sliceAttendance }</p>
        <p>{ data.title }</p>
      </MovieInfo>
    </CardWrapper>
  );
};

export default BoxOfficeCard;
